objet:
a pour objet ,dans la limite de son secteur géographique, le développement de tous services, de toute activité concourant au maintien ou au retour à leur domicile, des personnes âgées, des malades et des personnes en situation de handicap; son secteur géographique est : le sud du Territoire de Belfort ainsi que les communes du Doubs proches; la définition de ce secteur géographique n'interdira pas à l'association, notamment pour des personnes déterminées, d'intervenir en dehors de ce secteur pour des considérations de pertinence territoriale;
elle pourra, dans le cadre de ces services d'aides et de soins à domicile, et ayant recours à du personnel qualifié :
informer, accompagner aider et apporter des soins à toutes personnes pour faciliter leur maintien à leur domicile ou dans tout autre domicile de substitution

l'association a pour objet le développement de tous services, de toutes activités :
-	concourant au maintien ou au retour à leur domicile, des personnes âgées, des malades et des personnes en situation de handicap ;
-	apportant aux personnes et aux familles une assistance personnelle à leur domicile dans la garde d'enfants ou la réalisation des tâches ménagères ;
-	favorisant l'inclusion sociale par l'accès à la formation et au travail des personnes en situation d'insertion sociale et professionnelle
elle pourra, dans le cadre de ces services d'aides et de soins à domicile, et en ayant recours à du personnel qualifié :
-	informer, accompagner, aider et apporter des soins à toutes personnes pour faciliter leur vie à domicile ou dans tout autre domicile de substitution ;
-	apporter tous services concourant au confort des personnes à domicile ;
-	seconder les parents dans leurs fonctions parentales ;
-	initier, coordonner, mettre en uvre et promouvoir toutes actions contribuant à la création et le développement de tout service ou structure de soutien à domicile envers les familles, les personnes âgées, les retraités, les personnes handicapées, les personnes isolées et les malades ;
-	initier, participer et développer tout partenariat ou toute collaboration avec des structures privées ou publiques intervenant dans le même secteur d'activités ;
-	participer à la création et au développement de toute structure juridique spécifique qui exercerait des activités connexes et complémentaires
dans le cadre de son action d'inclusion sociale, l'association pourra :
-	accueillir et accompagner des personnes en situation d'exclusion pour construire et finaliser avec elles un parcours d'insertion sociale et professionnelle,
-	leur faire acquérir un savoir-faire professionnel, en les mettant en situation réelle d'activité,
-	les faire bénéficier d'un encadrement leur permettant un retour ou un accès à l'emploi,
-	 contribuer avec les autres acteurs sociaux, par un accompagnement individualisé, à la réduction de leurs difficultés sociales
l'association inscrit son développement au sein d'un réseau appelé "Réseau APA" qui rassemble des associations de l'économie sociale et solidaire partageant les mêmes valeurs dont les principales sont la primauté de la personne et de la solidarité. Aussi l'association adhère et participe activement au Groupement de coopération sociale et médico-sociale (GCSMS) "APA Stratégie", structure institutionnelle du "réseau APA" Le GCSMS "APA Stratégie" a notamment pour objet de déterminer la stratégie du réseau APA, d'en consolider la gouvernance et d'en assurer la représentation auprès des partenaires publics et privés

créer et développer chez les apprentis et stagiaires de la formation professionnelle, le sens de l'esprit physique et sportif, l'esprit de compétition et d'entreprise, de compréhension, d'entraide et de solidarité; 
resserrer les liens entres les personnels du CFA et les apprentis en favorisant l'organisation d'activités culturelles, économiques et intellectuelles communes et développer le sens civique, moral et social des membres;
organiser des services associatifs au magasin pédagogique du CFA municipal de Jackie Drouet, permettant aux apprentis et aux stagiaires de la formation professionnelle de mettre en oeuvre leurs projets; 
favoriser l'investissement des équipements sportifs
favoriser l'investissement de matériel pédagogique

l'exercice public du culte musulman, initiation à la langue arabe, la connaissance de la religion musulmane et soutien scolaire aux enfants et adultes;
élargir l'échange culturel intra et inter-communautaire; 
la célébration des fêtes musulmanes; 
l'organisation et l'accomplissement des rites funéraires suivant la tradition musulmane;
subvenir aux frais, à l'entretien et à l'exercice public du culte des musulmans;
participer à la lutte contre toutes les formes de radicalisme, d'extrémismes et communautarisme;
ses moyens d'action son la tenue des réunions de travail et d'assemblées périodiques, la publication, les conférences, l'organisation de manifestation et toutes initiatives pouvant aider à la réalisation de l'objet de l'association.
elle pourra apporter son aide et assistance à toutes association poursuivant un but identique; elle pourra acquérir, louer ou construire les terrains et les immeubles pouvant servir aux buts qu'elle s'est fixés, et d'une manière générale réaliser toute transaction mobilière ou immobilière en vue de l'exercice de culte public des musulmans;
le fonctionnement de l'association sera réglé par les présents statuts en conformité avec la constitution de culte des musulmans

de lutter contre l'isolement des personnes âgées, personnes atteintes d'un handicap, des personnes sans domicile fixe et de jeunes,
notre association mettra en place un accompagnement individuel ou en groupe pour les sorties culturelles et les loisirs, cinéma, musée, ballade, concert, restaurant, rencontre sportive; 
partant du désir des personnes concernées cet accompagnement sera assuré, du début à la fin de l'activité, par nous et des bénévoles encadrés par les professionnels de l'association;
une action contribuera au ralentissement de la perte d'autonomie et à l'intégration des personnes âgées, des personnes handicapées, des personnes sans domicile fixe trop souvent isolées et un peu oubliées, nous essayerons de donner une deuxième chance aux jeunes par notre écoute et disponibilité, aide à la recherche d'emploi,

création d'événements ( de tous types : cosplays, sportif, esportif, tournois et autres manifestations événementielles) qui auront pour but de dynamiser les environs ; 
Création et gestion d'un club eSportif (l'eSport est la pratique collective du jeu vidéo) 
Création et gestion d'équipes eSport (ces équipes pourront alors représentés l'association dans différentes compétitions) 
L'association fera l'objet d'activités économiques à travers le coût de participation à ses événements et merchandising ;

cette association a pour but : 
-	D'accueillir les enfants du département du Doubs et du Territoire de Belfort dans le but de rendre service aux familles en proposant un moyen de garde alternatif, une Maison d'Assistantes Maternelles
-	De mettre à la disposition d'assistant (e) s maternel (le) s agréé (e) s, en échange d'une participation mensuelle aux charges et frais de fonctionnement, des locaux entièrement dédiés à leur exercice ; 
-	De permettre aux assistant (e) s maternel (le) s agréé (e) s d'exercer leur métier dans des conditions optimales afin d'offrir un service de qualité ; 
-	De gérer le fonctionnement financier de la Maison d'Assistantes Maternelles
-	L'organisation occasionnelle événements, manifestations et toutes initiatives pouvant aider à la réalisation de l'objet de l'association

promouvoir la culture geek mener des actions concertées afin de développer les événements dédiés à cette culture avec des individus ou d'autres organisations ayant des objectifs proches
représenter, informer, rassembler les joueurs, amateurs, passionnés de la culture geek et ses différents courants
organiser toutes opérations industrielles, commerciales ou financières, mobilières ou immobilières, pouvant se rattacher directement ou indirectement à l'objet ou susceptibles d'en faciliter l'extension ou le développement ;

assurer, dans un esprit de respect et de promotion humaine, le logement, la prise en charge et l'accompagnement de femmes avec ou sans enfants, rencontrant des difficultés dans leur parcours d'insertion professionnelle.
A cette fin, l'association met en oeuvre tous les moyens nécessaires pour mener à bien des actions éducatives sociales et d'insertion professionnelle, conventionnées ou non avec les collectivités publiques; 
l'association ne poursuit aucun but lucratif, politique ou religieux;
lesdits moyens se déclinent par la location d'appartements et par la création d'une micro-crèche à horaires atypiques, appelée les Ptits Jeannoux, située à la même adresse

l'établissement dit Jeunesse et Vie a pour buts : 
1- L'accompagnement de la jeunesse dans une démarche de progrès spirituel et de promotion sociale via l'enrichissement spirituel, l'excellence académique, le développement de talents artistiques ou artisanaux et l'ouverture culturelle ; 
2- L'instauration ou la restauration des conditions permettant à tous jeunes de se doter de comportements nouveaux afin qu'ils s'ouvrent à un avenir dont ils ne soupçonnaient pas l'existence ou dont ils se croyaient exclus ; 
3- L'expression et le prolongement temporels des valeurs spirituelles et l'éthique chrétienne fondée sur le message de la Bible ;

promotion et contribution au développement de l'instruction, de l'éducation et de la formation intellectuelle, physique et morale de la jeunesse dans le département du Territoire-de-Belfort
Conduite de l'action de l'association sur la base du volontariat de ses membres dans l strict respect des principes de la liberté individuelle et de la dignité humaine ; 
Création, gestion et animation, dans le cadre de la législation en vigueur, d'écoles, de centres de formation, de clubs de sport, de loisirs et tous autres établissements et activités correspondant à son objet social et mise en oeuvre des moyens nécessaires à la réalisation de son objet ;

développer la citoyenneté et la vie associative étudiante ; 
Favoriser l'échange entre étudiants actuels et anciens étudiants ; 
Accompagner les étudiants dans la réalisation de leurs initiatives, projets individuels ou collectifs ; 
Promouvoir les idées de solidarité, de tolérance et de liberté ; 
Établir et maintenir le lien entre les Anciens, notamment ceux de promotions plus éloignées de celles que l'on a pu côtoyer pendant nos années estudiantines ; 
Assister ceux qui en ont besoin dans leur carrière ; 
Défendre les intérêts des diplômés ; 
Promouvoir la qualité de la formation et du diplôme,

a pour objet la pratique de l'éducation physique et des sports et plus particulièrement de développer et de favoriser, par tous moyens appropriés sur le plan sportif et accessoirement artistique et scientifique, la connaissance du monde subaquatique, ainsi que celle de tous les sports et activités subaquatiques et connexes, notamment ceux portés par la Fédération Française d'Etudes et de Sports Sous-Marins (F ; F ; E ; S ; S ; M ;) : la plongée en scaphandre, l'archéologie, la biologie, l'apnée, la nage avec accessoires pratiquée en mer, piscine, lac ou eau vive
L'association met tout en uvre pour assurer une représentativité féminine dans toutes ses activités et instances; 
L'Association permet, dans certaines conditions, la pratique des activités subaquatiques, aux personnes handicapées; 
Elle s'inscrit dans une démarche de développement durable; Elle contribue au respect des lois et règlements ayant pour objet la conservation de la faune, de la flore et des richesses sous-marines, notamment en tenant ses adhérents informés des dispositions édictées à cette fin; 
L'Association respecte les règles d'encadrement, d'hygiène et de sécurité applicables aux disciplines sportives pratiquées par leurs membres; 
Elle est affiliée à la F ; F ; E ; S ; S ; M ; et bénéficie de l'assurance Fédérale qui garantit la responsabilité civile de ses membres pour une somme illimitée ; 
Elle reconnaît avoir pris connaissance des Statuts et du Règlement intérieur de la F ; F ; E ; S ; S ; M ; et elle s'engage à les respecter, de même que : les règlements des Commissions, les décisions des Assemblées Générales, du Comité Directeur et les Garanties de Technique et de Sécurité pour la Plongée en scaphandre conformément à la réglementation en vigueur ; 
L'Association s'interdit toutes les discussions ou manifestations présentant un caractère racial, politique ou confessionnel; 
L'Association s'interdit toute discrimination; La Liberté d'opinion et le respect des droits de la défense sont assurés;

organiser, coordonner, développer et contrôler la pratique du tennis de table, sous toutes ses formes sur le Territoire du Département;
organiser les compétitions et notamment les championnats départementaux, toutes catégories, inhérents à cette pratique;
défendre les intérêts moraux et matériels du tennis de table du département

l'association a pour objet : 
- L'enseignement et la formation en général du secourisme sous toutes ses formes au grand public, entreprises, établissements scolaires en France et à l'étranger, etc ; ; 
- De participer à l'information et la formation du public, en matière de prévention, hygiène, sécurité des conditions de travail, défenses civile, protection générale, hébergement, évacuation de population, risques nucléaire, biologique, chimique, etc ; ; 
- La mise à la disposition des pouvoirs publics, de moyens logistiques et humains, dans le cadre des missions de sécurité civile ; 
- De porter aide à la création des réserves communales de Sécurité Civile ; 
- De récompenser, par l'attribution de diplômes d'honneur, médailles et trophées, des personnes oeuvrant à l'objet de l'association ; 
L'association peut agir dans le cadre de ses missions par voie de conventions avec les pouvoirs publics et les personnes morales de droit privé ;

l'Association IN'Terre ActiV Environnement, Énergie, Habitat a pour objetde développer et d'accompagner dans une perspective de développement soutenable : 
- de nouveaux modèles respectueux des femmes, des hommes, du cadre et de la qualité de vie, 
- des projets permettant la protection de l'environnement et des équilibres fondamentaux : eau, air, sols, énergie, paysages, biodiversité, habitat ;  
- la rencontre de différents acteurs pour co-construire des initiatives transposables ; 
- la fédération d'acteurs autour de projets communs
-  le changement pour une culture partagée de l'environnement

promouvoir la connaissance de l'art du shiatsu confort sur le Territoire de Belfort; 
les massages se pratiquent habillés sur un futon;
il vise le confort énergétique et le bien être globales de ses adhérent(e)s;
Accès à des conseils de prévention santé basés sur les apports de la médecine traditionnelle chinoise, la praticienne grâce à l'association poursuit sa formation en shiatsu thérapeutique

cette association a pour objet le développement et la promotion de Ia culture traditionnelle orientale ; 
L'association a également pour objet l'information, l'enseignement et la transmission aux parents et futurs parents de techniques, pratiques, connaissances, ouüls et expériences de soutien à la parentalité ; L'association a pour philosophie et éthique le respect des besoins de l'enfant de l'adulte, dans le respect de I'environnement
L'association se fixe pour but l'épanouissement moral et physique de l'homme, c'est pourquoi elle s'interdit toute discussion ou manifestation présentant un caractère politique, confessionnel ou sectaire ;

a pour but :
de promouvoir et d'encourager les échanges, l'ouverture à l'environnement social et culturel ainsi que les pratiques et activités socioculturelles périscolaires;
de contribuer à assurer dans les meilleurs conditions la vie et le fonctionnement du bar associatif et du centre socioculturel;
de développer le sens de la citoyenneté, de l'éco-citoyenneté et de l'autonomie des jeunes en les formant à la vie associative, aux responsabilités de gestion et d'organisation d'activités et aux notions d'éco-responsabilité;
de prolonger les actions d'animation et de rayonnement de l'établissement hors de l'établissement dans le milieu environnant

développement de la pratique d'activités physiques et / ou sportives des publics qui en sont éloignés : 
personnes en situation de handicap mental ; personnes en situation de handicap physique, visuel et auditif ; personnes hospitalisées et /ou atteintes d'une affection de longue durée ; personnes accidentées de la vie en rééducation ; personnes âgées ; personnes résidentes des quartiers prioritaires de la politique de la ville ; personnes en recherche d'emploi ; toute personne en difficulté avec elle-même et/ou en difficulté avec les autres ; 
