Inclusion sociale par le sport
Développement de l'utilisation du sport dans les dispositifs d'insertion professionnelle par la co-construction de projets avec les associations, les structures institutionnelles et les acteurs du monde économique ;

lutter contre la prolifération féline des chats errants par la mise en place de campagnes de stérilisation leur conférant ainsi le statut de chats libres ; 
Proposer à l'adoption sous contrat associatif les chats et chatons sociables ou socialisés pris en charge après recherches infructueuses du/des propriétaires ; 
Veiller au suivi des populations de chats régulées par l'association, relâchés sur leur lieu de vie : protection, nourrissage, soins, etc ; 
Collaborer avec les vétérinaires, municipalités et collectivités dans le cadre de sa mission de protection féline ; 
Travailler avec des familles d'accueil dans le cadre du programme d'adoption, les former et les encadrer ; 
Assurer le suivi des animaux adoptés ; 
Offrir des produits à la vente et mettre sur pied des actions en vue de collecter des fonds et dons de toutes nature afin de financer ses actions ; 
L'association étend son action exclusivement sur la Commune de Delle et aux communes limitrophes dans le cadre de conventions, ce périmètre peut être élargi au cas par cas, après dépôt d'un dossier complet des demandeurs ;

de récolter des fonds pour l'école;
des ventes, des activités, des ateliers seront proposés;
l'argent récolté permettra de soutenir l'école financièrement, proposer des projets, financer des voyages et du matériel

informer, sensibiliser et former les jeunes sur l'actualité politique, économique, social et entrepreneuriale ; 
