Diffuser et valoriser le travail et l'avis des jeunes sur les thématiques abordées ;

collectage, sauvegarde et traitement d'informations et de documents de toute nature se rattachant à l'histoire sociale du Territoire de Belfort et plus particulièrement, à l'histoire du syndicalisme et leur exploitation à des fins de formation et de recherche historiques ; 
Mise en uvre d'études, de recherches visant à la transmission de l'histoire sociale et à de larges confrontations dans les domaines de son investigation ; 
Contribution à l'information et la formation des militants syndicaux, des salariés, des retraités, des étudiants et de toutes organisations intéressées à l'histoire sociale ; Toutes les activités de l'Institut sont interdisciplinaires ;

gérer administrativement, financièrement et moralement la MAM (Maison d'Assistantes maternelles) formée par 2, 3 ou 4 (maximum) assistant (e) s maternel (le) s agréé (e) s par le Président du Conseil Départemental ; 
Cette structure permet la prise en compte de chaque enfant accueilli dans son individualité tout en offrant l'avantage d'être en collectivité ; 
Mettre à la disposition de ses assistant (e) s maternel (le) s, des locaux et du matériel entièrement dédiés à l'accueil de jeunes enfants et de leur famille, en échange d'une participation mensuelle aux charges et frais de fonctionnement de la structure ; 
Organiser des activités d'éveil et de prévention à destination des enfants et de leur famille ponctuellement ou régulièrement : sortie, intervenants extérieurs (type professionnels de santé) , animations

étudier et rechercher les moyens techniques les mieux adaptés aux secours d'urgence, notamment la modernisation du matériel, la formation de ses membres et de leurs salariés et tous les moyens destinés à améliorer les conditions d'assistance aux personnes en détresse; intervenir pour permettre la coordination des moyens publics et privés sous toutes leurs formes;
promouvoir tout moyen et toute organisation propre à apporter son aide et celle de ses membres aux pouvoir publics régionaux dans le cadre des plans de secours et d'assistance sanitaire d'urgence;
la participation à l'organisation de la garde départementale assurant la permanence des transports sanitaires et les interventions UPH à la demande du CRA 15.
représenter l'ensemble des Entreprises de Transport Sanitaire du département 90

d'uvrer en faveur de la pérennité d'une offre de santé globale pour la population Nord Franche Comté;
de renforcer les collaborations entre les acteurs du sanitaire, du médico-social et du social du bassin de vie, quelque soit le mode d'exercice;
de développer l'exercice coordonné entre professionnels de santé de 1er et/ou de 2ème recours;
de participer à la formation initiale et continue des professionnels de santé et encourager la recherche en santé

organiser le sport du Billard "Carambole" dans le Club, d'en promouvoir et développer la pratique des différents types de jeux sous toutes leurs formes;
en faire respecter les règles, organiser et contrôler les compétitions officielles, les tournois et exhibitions, conformément aux dispositions de la F.F.B.
participer à l'éducation par l'enseignement des différents disciplines et de contribuer à la remise de prix, récompenses et distinctions

l 'association a pour objet, dans la limite de son secteur géographique, le développement de tous services, de toute activité concourant au maintien ou au retour à leur domicile, des personnes âgées, des malades et des personnes en situation de handicap ; 
