l 'association a pour objet, dans la limite de son secteur géographique, le développement de tous services, de toute activité concourant au maintien ou au retour à leur domicile, des personnes âgées, des malades et des personnes en situation de handicap ; 
Son secteur géographique est : Sud Territoire de Belfort et environs ; 
La définition de ce secteur géographique n'interdira pas à l'association, notamment pour des prestations déterminées, d'intervenir en dehors de ce secteur pour des considérations de pertinence territoriale ; 
Elle pourra, dans le cadre de ces services d'aides et de soins à domicile, et en ayant recours à du personnel qualifié : 
-	Informer, accompagner, aider et apporter des soins à toutes personnes pour faciliter leur maintien à leur domicile ou dans tout autre domicile de substitution ; 
-	Apporter tous services concourant au confort des personnes à domicile ; 
-	Prendre en gestion toutes activités de ce type qui lui seraient confiées dans son secteur  géographique ; 
-	Assurer toute intervention qui serait sollicitée par les collectivités publiques ; 
L'ensemble de ces activités s'effectueront dans le cadre du RESEAU APASAD COLCHIQUE et l'association sera adhérente à ce réseau ;

