cette association, fondée le 10 avril 2020, a pour objet l'autonomie citoyenne par la réappropriation, par et pour toutes et tous, des enjeux de notre société au service des biens communs ; 
Elle a vocation à se transformer en SCOP à responsabilité limitée et au capital variable au courant de l'année 2021 ; 
La future coopérative sera régie par la loi du 19 juillet 1978 portant statut des sociétés coopératives de production et ses décrets d'application, la loi du 10 septembre 1947 portant statut de la coopération, et le livre II du Code de commerce et plus particulièrement ses articles L ;  231-1 à L ;  231-8 ; 
Inscrites notamment dans des dimensions d'éducation populaire, de culture et de recherche, les actions de cette organisation se structurent autour de quatre piliers : 
- S'émanciper : déconstruire ses conditionnements, comprendre et alimenter le débat public en profondeur ; 
- Imaginer : bâtir de nouveaux imaginaires pour revoir ensemble les choses en grand et  préparer demain ; 
- Dialoguer : faciliter la participation et construire le désaccord pour faire vivre la démocratie ; 
- Agir : retrouver le pouvoir d'agir collectivement et provoquer un changement de système en coopération avec l'ensemble du vivant ; 
Et réveiller ainsi notre capacité collective à conduire la société vers un projet éthique et solidaire de vivre ensemble ; 
Pour ce faire, elle proposera des dispositifs d'expertise en stratégie, d'accompagnement et de formation à travers des supports interactifs et en présentiel ;

