l'objectif du GEIQ STAFF EMPLOI est de gérer des emplois majoritairement développés en Bourgogne-
Franche-Comté en contribuant : au partage du temps de travail des salariés et à la répartition des coûts ; à l'apprentissage de la fonction d'employeur pour les adhérents ; à l'approche globale des questions de formation et de professionnalisation ; à l'allégement, pour les dirigeants, des tâches administratives occasionnées par l'emploi ; 
L'association, dans le cadre, entre autres, des lois du 1er juillet 1901, du 25 juillet 1985, du 2 août 2005, et du 13 juillet 2011 (2011-893) se donne pour but de : mettre à disposition auprès de ses membres, un ou plusieurs salariés, liés à ce groupement par
un contrat de travail ; apporter à ses membres son aide et son conseil en matière d'emploi et de gestion des ressources
humaines ; 
Le GEIQ organise des parcours d'insertion et de qualification pour les salariés rencontrant des difficultés
d'accès à l'emploi, qu'ils mettent à la disposition de leurs membres ; Conformément à la règlementation des groupements d'employeurs, au projet associatif d'un Groupement d'Employeurs pour l'Insertion et la Qualification, et dans le respect de la convention collective du sport (IDCC 2511) que le groupement appliquera à ses salariés, le groupement a pour objet : L'embauche de salariés par un contrat de travail adapté à la mise en place de parcours d'insertion et de qualification et la mise à disposition à but non lucratif de ces salariés auprès des employeurs qui en sont membres ; De permettre à des personnes éloignées de l'emploi de s'engager dans des parcours d'insertion et de qualification à travers l'alternance entre périodes de formation et périodes de mise à disposition chez les employeurs adhérents au groupement ; De déterminer et de mettre en uvre des actions de pré-recrutement et de recrutement pour les
adhérents du groupement ; La recherche collective de toutes les possibilités d'emploi stabilisé à l'issue du contrat de travail
signé avec le Groupement, en particulier au sein de ses entreprises adhérentes ; De mettre en place des actions de promotion des métiers recherchés par ses adhérents ; D'apporter à ses membres son aide ou son conseil en matière de gestion des ressources
humaines ;

