Premier axe : le lien avec les Autres, à travers des actions telles que des activités yoga pour les enfants et adolescents, des ateliers psychocorporels pour adultes, des activités de médiation corporelle pour les familles, ainsi que des activités artistiques, culinaires et manuelles destinées à un large public ; 
Deuxième axe : le lien avec la Nature, à travers des activités de jardinage, des promenades guidées et des activités de plein air à thème ;

